description:
Alien Planets Revealed

Science Documentary hosted by Lance Lewman, published by PBS broadcasted as part of PBS Nova series in 2014 - English narration


Information
------------------------------

It's a golden age for planet hunters: recently, they've discovered more than 750 planets orbiting stars beyond our sun. Some of them, like a planet called Kepler-22b, might even be able to harbor life. What would that life look like? Combining startling animation with input from expert astrobiologists, Alien Planets Revealed takes viewers on a journey of the imagination as we &quot;build&quot; aliens from the ground up.
What chemical building blocks will make up their genetic code? How will life get started and how will the exotic environment on a planet like Kepler-22b drive evolution? Bringing the creative power of veteran animators together with the latest discoveries in astrobiology, Alien Planets Revealed provides a glimpse of the creatures we might one day encounter beyond our solar system.

